content:
The sfdcRegister transformation registers a dataset to make it available for queries. Users can’t view or run queries against an unregistered dataset.

You don’t need to register all datasets, but carefully choose which ones because:

* The total number of rows in all registered datasets can’t exceed 100,000 per platform license, or 250 million per platform license purchased before October 20, 2015.
* Users that have access to registered datasets can query their data, but row-level security can be applied to restrict access.

The sfdcRegister transformation overwrites the current version of the dataset. It is used as shown in the following example:
{
   "Extract_Opportunities": {
      "action": "sfdcDigest",
      "parameters": {
         "object": "Opportunity",
         "fields": [
            { "name": "Id" },
            { "name": "Name" },
            { "name": "Amount" },
            { "name": "StageName" },
            { "name": "CloseDate" },
            { "name": "AccountId" },
            { "name": "OwnerId" }
         ]
      }
   },
   "Register_Oppportunities_Dataset": {
      "action": "sfdcRegister",
      "parameters": {
         "alias": "Opportunities",
         "name": "Opportunities",
         "source": "Extract_Opportunities",
         "rowLevelSecurityFilter": "'OwnerId' == \"$User.Id\""
      }
   }
}

When you define an sfdcRegister transformation, you set the action attribute to sfdcRegister and specify the parameters.
